import AppLayout from '../components/AppLayout';
import Head from 'next';

const Profile = () => {
  return (
    <>
      <Head>
        <title>Profile | NodeBird</title>
      </Head>

      <AppLayout>
        <div>Profile</div>
      </AppLayout>
    </>
  );
};

export default Profile;
